// })

class App extends Component {
    constructor(){
      super()
    }
    getPictures(){
      fetch("https://api.unsplash.com/search/photos?query=london&client_id=U2SE5vPtSLO0Mq163QBMM4t4GxahTwC99CzfvJLYavo")
      .then(res => res.json())
      .then(res => this.render(res) )
      .catch(err => console.log(err))
    }

    render(){
      return (
        <div>
          <h1 onClick={this.getPictures}>Hello there</h1>
          <div>{this}</div>
        </div>
      )
    }
}

export default App;
